import Member_nav from "./Member_nav";
import LN_pic from "./LN_pic"
import { Routes, Route, NavLink } from "react-router-dom";
import React from "react";
import Member02 from "./Member02";
import Member03 from "./Member03";
import Member04 from "./Member04";
import Member05 from "./Member05";
import Member06 from "./Member06";
import Member07 from "./Member07";
import MenuIcon from "../MenuIcon";

function Member01(params) {
  return (
    <>
      <style>
        {`
          html, body {
            background-color: #F3F6F4;
          }

          @media (max-width: 400px) {
            .member_part{
              display: flex;
              flex-direction: column;
            }

            .mem_links{
              align-items: center;
              margin-bottom: 0px !important;
              display: flex !important;
              flex-wrap: wrap;
              flex-direction: row !important;
              justify-content: center;
            }

            .nav {
              display: flex;
              padding: 5px;
            }

            .member_part{
              margin-top: 20px !important;
            }

            .left_side {
              margin-right: 0px !important;
              display: flex !important;
              flex-direction: column !important;
            }

            .mem_info {
              text-align: center !important;
              margin: 10px 0px 10px 0px;
            }

            .mem_pic {
              margin-top: 20px;
            }

            .social-link{
              display: flex !important;
              justify-content: flex-end !important;
              margin-top: 240px;
              margin-left: -20px !important;

            }
          }
        `}
      </style>
      <div className="container">
        <div className="head_nav" style={{ display: "flex" }}>
          <div className="left_side">
            <Member_nav />
          </div>
          <div
            className="title"
            style={{
              color: "#3C8350",
              width: "100vw",
              textAlign: "center",
              marginTop: "10px",
            }}
          >
            <h1>MEMBER</h1>
          </div>
          <div className="menuIcon" style={{margin: "20px 20px 0px 0px"}}>
            <MenuIcon />
          </div>
        </div>
        <LN_pic />
        <div className="member_part" style={mem_part}>
          <div className="left_side" style={left_side}>
            <nav className="mem_links" style={mem_links}>
              <NavLink
                className="nav"
                to={"/"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "#3C8350",
                  fontWeight: "bold",
                }}
              >
                Jay B
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member02"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Mark
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member03"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Jackson
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member04"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Jinyoung
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member05"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Youngjae
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member06"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                BamBam
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member07"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Yugyeom
              </NavLink>
            </nav>
            <div className="mem_info" style={mem_info}>
              <h1 style={{ marginTop: "0px", color: "#3C8350" }}>
                Jay B. | 임재범
              </h1>
              <h3 style={{ marginTop: "-15px", fontWeight: "400" }}>
                Lim Jaebeom
              </h3>
              <h3 style={{ marginTop: "-15px", fontWeight: "400" }}>
                January 6, 1994
              </h3>
            </div>
          </div>

          <div className="mem_pic">
            <img
              src="https://res.theconcert.com/c_thumb/c6fe72c622c0d53f0dc53597eab7aab35/jb.jpg"
              alt="JB"
              style={mem_pic}
            ></img>
          </div>

          <div className="mem_social" style={social_link}>
            <div className="social-link">
              <a
                href="https://www.facebook.com/GOT7Official/"
                target="_blank"
                rel="facebook"
              >
                <i className="icon" style={a_icon}>
                  <img
                    className="facebook"
                    src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/2021_Facebook_icon.svg/2048px-2021_Facebook_icon.svg.png"
                    style={icon}
                    alt="facebook"
                  ></img>
                </i>
              </a>
              <a
                href="https://twitter.com/jaybnow_hr"
                target="_blank"
                rel="twitter"
              >
                <i className="icon" style={a_icon}>
                  <img
                    className="twitter"
                    src="https://cdn4.iconfinder.com/data/icons/social-media-icons-the-circle-set/48/twitter_circle-512.png"
                    alt="twitter"
                    style={icon}
                  ></img>
                </i>
              </a>
              <a
                href="https://www.instagram.com/jaybnow.hr/"
                target="_blank"
                rel="instagram"
              >
                <i className="icon" style={a_icon}>
                  <img
                    className="instagram"
                    src="https://toppng.com/uploads/preview/instagram-logo-circle-11549679754rhbcorxntv.png"
                    alt="instagram"
                    style={ex_icon}
                  ></img>
                </i>
              </a>
              <a
                href="https://youtube.com/@GOT7_isourname"
                target="_blank"
                rel="youtube"
              >
                <i className="icon" style={a_icon}>
                  <img
                    className="youtube"
                    src="https://www.pngitem.com/pimgs/m/11-114700_youtube-red-circle-youtube-circle-icon-png-transparent.png"
                    alt="youtube"
                    style={ex_icon}
                  ></img>
                </i>
              </a>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default Member01;

const mem_links = {
  display: "flex",
  flexDirection: "column",
  textDecoration: "none",
  textAlign: "right",
  marginBottom: "180px",
};

const mem_pic = {
  width: "280px",
  height: "435px",
  objectFit: "cover",
  borderRadius: "20px",
};

const mem_part = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  marginTop: "80px",
};

const left_side = {
  display: "flex",
  flexDirection: "column",
  marginRight: "25px",
};

const mem_info = {
  textAlign: "right",
  marginBottom: "-20px",
};

const icon = {
  width: "25px",
  height: "25px",
};

const ex_icon = {
  width: "25px",
  height: "25px",
  borderRadius: "360rem",
};

const a_icon = {
  display: "flex",
  flexDirection: "column",
  margin: "10px",
};

const social_link = {
  marginLeft: "20px",
  marginTop: "-300px",
};
